query GetTempOpRecordings($input: TemporaryOperationRecordingsInput!) {
  temporaryOperationRecordings(input: $input) {
    ...TempOpRecordingFragment
    __typename
  }
}

fragment TempOpRecordingFragment on TemporaryOperationRecording {
  id
  operationName
  sessionId
  query
  variables
  response
  schemaUrl
  schemaHash
  referrer
  __typename
}
